import '../../../App';
import Footer from '../../Footer';
import { Link } from 'react-router-dom';
import Navbar from '../../Navbar';
import './Registration-Form'


function Registration_Form() {
  return (
    <>
      <Navbar
      NavButtonName='Login'
      NavButtonlink='/login'/>


      <Footer/>
    </>
  );
}

export default Registration_Form;
